webpackJsonp([37430703158513],{1162:function(e,t){e.exports={data:{allContentfulPage:{edges:[{node:{node_locale:"en",slug:"bug-bounty",title:"Bug Bounty",metaTitle:"TenX - Bug Bounty",metaDescription:{metaDescription:"The bug bounty programme of TenX."},metaKeywords:"TenX",navigationSection:"Not in Navigation Menu",content:[{containerName:"TenX Bug Bounty Programme",content:[{__typename:"ContentfulQuoteBlock",quoteTitle:"Important",quoteBody:{quoteBody:"Please take note of the below eligibility requirements before making your submission."}},{__typename:"ContentfulTextBlock",body:{body:'Bug Bounty scope includes:\n\n- iOS and Android wallet app\n- API at getonebit.com\n- Tenx.tech website (Severe bugs only, please refer to exclusion list for details)\n\nEXCLUSION LIST:\n\n- Client-side "XSS" on any domain/subdomain\n- Clickjacking on any domain/subdomain\n- merch.tenx.tech (Submit via [Shopify\'s Bug Bounty Programme](https://hackerone.com/shopify "Shopify\'s Bug Bounty Programme"))\n- support.tenx.tech  (Submit via [Zendesk\'s Bug Bounty Programme](https://hackerone.com/zendesk "Zendesk\'s Bug Bounty Programme"))\n- chat.tenx.tech (Submit an issue to [Rocket.Chat\'s github](https://github.com/RocketChat/Rocket.Chat/issues "Rocket.Chat\'s github"))'}},{__typename:"ContentfulTextBlock",body:{body:"### We urge submitters to:\n\n- Give us reasonable amount of time to close any submitted vulnerabilities.\n- Not use any other channel to submit vulnerabilities other than the method described below. \n- Not damage any TenX users or TenX itself, and not disclose any data found during the process of discovery. "}},{__typename:"ContentfulTextBlock",body:{body:"### Caveat\n\nIn order to be eligible for rewards the following conditions must first be met:\n\n1. Vulnerabilities must be encrypted using our [PGP Public Key](https://assets.ctfassets.net/xecblntwky6m/2cIatqEJtGacu4mAaQqGKo/919fad2c261644d7d0285ef4b7fb7eb4/bugbounty.key)\n2. The security vulnerabilities have to be applicable in a real world attack scenario. \n3. The vulnerability has to be demonstrated to our team in a comprehensible/reproducible way.\n4. The vulnerability may not be published until it has been patched, and you have obtained permission from TenX. \n\nThe following Table is an estimate for reward amounts (depending on the severity, we might pay out higher rewards):\n\nPlease submit details of your discovered vulnerabilities, encrypted, to the TenX Security Team at: bugbounty@tenx.tech"}},{__typename:"ContentfulTextBlock",body:{body:"### Rewards\n\nEvery security vulnerability submitted that results in a fix on our side will receive a monetary reward based on the below table. These rewards will be paid in the equivalent value of Bitcoin. If your report is deemed eligible, you will be contacted to provide further details. \n\n\n"}},{__typename:"ContentfulImageBlock",image:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:.6206896551724138,src:"//images.ctfassets.net/xecblntwky6m/15q303RRYoSoE4we0kAQ8Q/eb534f37666cf1e31157892ed4be1cba/bugBounty.jpg?w=800&q=70",srcSet:"//images.ctfassets.net/xecblntwky6m/15q303RRYoSoE4we0kAQ8Q/eb534f37666cf1e31157892ed4be1cba/bugBounty.jpg?w=200&h=322&q=70 200w,\n//images.ctfassets.net/xecblntwky6m/15q303RRYoSoE4we0kAQ8Q/eb534f37666cf1e31157892ed4be1cba/bugBounty.jpg?w=400&h=644&q=70 400w,\n//images.ctfassets.net/xecblntwky6m/15q303RRYoSoE4we0kAQ8Q/eb534f37666cf1e31157892ed4be1cba/bugBounty.jpg?w=800&h=1289&q=70 800w,\n//images.ctfassets.net/xecblntwky6m/15q303RRYoSoE4we0kAQ8Q/eb534f37666cf1e31157892ed4be1cba/bugBounty.jpg?w=864&h=1392&q=70 864w",sizes:"(max-width: 800px) 100vw, 800px"}}},{__typename:"ContentfulTextBlock",body:{body:"### Terms & Conditions\n\nBy making any submission of any information or content to bugbounty@tenx.tech and/or participating in any other form or manner in the TenX Bug Bounty Program as referred to above (the “Participation”):\n\n(a) you agree that each of TenX Pte. Ltd. and its related corporations (as defined in the Companies Act (Cap. 50) of Singapore) shall own all intellectual property rights to all of the information or content provided by you in connection with your Participation; and\n\n(b) you represent and warrant that your Participation and the foregoing agreement do not result in any infringement or breach (whether indirectly or directly, or in any form or manner) of intellectual property rights of any other person to any part of the information or content provided by you in connection with your Participation to any extent."}}]}]}}]}},pathContext:{id:"c22IA4kxuTGq2404oGGuaeA",contentfulId:"22IA4kxuTGq2404oGGuaeA",title:"Bug Bounty",slug:"bug-bounty"}}}});
